package tcs.ril.storebot.model;import com.google.gson.annotations.Expose;import com.google.gson.annotations.SerializedName;import java.util.List;public class ViewBtn {    @SerializedName("usersWithPendingPickup")    @Expose    private List<UsersWithPendingPickup> usersWithPendingPickup = null;    @SerializedName("text")    @Expose    private String text;    public List<UsersWithPendingPickup> getUsersWithPendingPickup() {        return usersWithPendingPickup;    }    public void setUsersWithPendingPickup(List<UsersWithPendingPickup> usersWithPendingPickup) {        this.usersWithPendingPickup = usersWithPendingPickup;    }    public String getText() {        return text;    }    public void setText(String text) {        this.text = text;    }}